import React from 'react'

function Data(TotalList) {
  return (
    <div>
    {TotalList.map((data,index)=>{


        return(
    
          <div key={index} >
            {data.name}
            {data.order}
          
          </div>
        )
    
      })}
    </div>
  )
}

export default Data
